import React from 'react';
import './Card.css';
import PaymentGateWay from './PaymentGateWay';
export default function DisplayCard({
    url,
    name,
    price
}) {

    return (
    <div className="display_card" onClick={e=>(<PaymentGateWay/>)}>
            <img src={url}
            height="100px"
            width="230px"
            ></img>
            <div className="container">
                <h4>Name :  {name}</h4>
                <h4>Price :  {price} </h4>
            </div>
        </div>
    );
}
